import React from "react";
import SearchIcon from "../../assets/icons/search.png";

import "./FormSearchBug.css";

const FormSearchBug = ({ handleSubmit, handleInputChange, inputValue }) => {
  return (
    <div className="navbar navbar-expand-lg navbar-dark bg-dark mt-5">
      <form onSubmit={handleSubmit}>
        <div className="input-group mb-3">
          <input
            type="text"
            className="form-control"
            placeholder="Nome do Inseto..."
            name="input-common-user"
            onChange={handleInputChange}
            value={inputValue}
          />
          <button
            class="btn btn-outline-secondary">
            Pesquisar
          </button>
          <div id="passwordHelpBlock" class="form-text">
            Your password must be 8-20 characters long, contain letters and
            numbers, and must not contain spaces, special characters, or emoji.
          </div>
        </div>
      </form>
    </div>
  );
};

export default FormSearchBug;

